import myAccount from './MyAccount.module.css'
import user_photo from './../../../images/user-photo.png'

const MyAccount = () => {
    return(
        <div className={myAccount.myAccount}>
            <img src={user_photo} alt=''></img>
            <p>Olena Burlaka</p>
        </div>
    )
}

export default MyAccount;
